import React from 'react'
import { Tabs } from '../../Components/CustomeDivs/Index'
const NavTab = () => {
    return(
        <Tabs className='bg-[yellow] w-[2rem] items-center'>
            <p>Tabs</p>
        </Tabs>
    )
}

const ChatsProfileTabs = () => {
    return(
        <Tabs className='bg-[green] w-['>
            <p>Tabs 2</p>
        </Tabs>
    )
}

const ChatsTabs = () => {
    return(
        <Tabs className='bg-[red]'>
            <p>Tabs 3</p>
        </Tabs>
    )
}

const Main = () => {
    return (
        <div className='flex flex-col items-center h-screen'>
            <div className="flex items-center bg-slate-400 w-4/5">
                <NavTab/>
                <ChatsProfileTabs/>
                <ChatsTabs/>
            </div>
        </div>
        

    )
    
}

export default Main
